import React from "react";
import './Ex';
function ExpenseItem() {
    return (
      <div className="expense-item">
        <div>March 17 2023 </div>
        <div className="expense-item__description">
          <h1> Car insurance</h1>
          <div className="expense-item__price"> $234,56 </div>
        </div>
      </div>
    );
}
export default ExpenseItem;
